# Code used for Validation
## global represents the dict derived from the complete corpus analyzed at once

dict_global = corpora.dictionary.Dictionary.load('global.dict')
## dict_f/g represent the 2 dict derived from analyzing part of the complete corpus where f+g = complete corpus

dict_f = corpora.dictionary.Dictionary.load('f.dict')
dict_g = corpora.dictionary.Dictionary.load('g.dict'

merge_with(dict_f, dict_g)
dict_f.filter_extremes()
dict_f.compactify()
## CONSIDERING AFTER FILTERING/COMPACTIFY THE MERGED_DICT SHALL BE EQUIVALENT TO THE GLOBAL DICT (where filering/compactify was applied), NO ERROR MESSAGE SHOULD APPEAR ON SCREEN.

for ids,token in dict_f.iteritems():
    if dict_f.dfs[ids] != dict_global.dfs[dict_global.token2id[token]]:
        ErrMsg = "Error at ID " + str(ids)
        paste(ErrMsg)

count = 0;
for ids, token in dict_global.iteritems():
    try:
        dict_f.token2id[token]
    except:
        count = count + 1;
        ErrMsg = "Error " +str(count) + " -- Unpresent token : " + token
        print(ErrMsg)

I've added a looping functionality on rows and columns, this will ease when scanning over a table for ex.

let the code talk :+1: 

```go
package main

import (
	"fmt"
	"github.com/NaySoftware/excelize"
	"os"
)

func main() {
	xlsx, err := excelize.OpenFile("WorkBook.xlsx")
	if err != nil {
		fmt.Println(err)
		os.Exit(1)
	}

	rows, err := xlsx.GetRows("Sheet1")
	if err != nil {
		fmt.Println(err)
	}

	for _, row := range rows {
		for _, colCell := range row.C {
			val, _ := colCell.GetValueFrom(xlsx)
			fmt.Print(val, "		")
		} // cols
		fmt.Println()
	} // rows

	fmt.Println()
} // main


```

Hi, it is an attempt to fix a round-off error of date and time valued cells set in time.Time. The following snippet demonstrates how to reproduce to the issue. Thanks!

```
package main

import (
	"github.com/xuri/excelize"
	"log"
	"time"
)

func main() {
	xlsx := excelize.NewFile()
	// 1970/01/01 1:00:00, but rounded off to 1970/1/1 0:59:02
	xlsx.SetCellValue("Sheet1", "A1", time.Date(1970, time.January, 1, 1, 0, 0, 0, time.UTC))
	err := xlsx.SaveAs("test.xlsx")
	if err != nil {
		log.Fatal(err)
	}
}
```

This pull request adds a new method for sheet `Rows(sheetname)`, it will return an iterator object. Then you can retrieve rows one by one. For example:

```Go
rows, err := xlsx.Rows("Sheet1")

for rows.Next() {
        for _, colCell := range rows.Columns() {
            fmt.Print(colCell, "	")
        }
        fmt.Println()
}
```

The goal of this PR is to stabilize the handling of different types and to improve tests. The changes are:
- value_counts, nuniques and type inference are cached;
- boolean variances are treated correctly, eg. True, False, 0, 1 including NaN or not;
- types like List, Tuple, Dict are now officially unsupported until we improve them;
- mixed columns are also correctly handled;
- add correlation threshold option and check recoded correlation parameter (memory heavy)
- add variable anchor to improve navigation and small UX improvements (works both in stand-alone HTML and Jupyter notebook by using scrollTo instead of real link anchors)

This should solve #76 #77 #70 #44 #29 #66 

Please review my changes and if agreed merge it.

